window.bookSummaryJSON = "<p>Elias Omari exists in the darkness that clouds his mind. Cress Devereaux exists in the light that inspires her soul. Together, they create beautiful shades of gray. </p> <p>An arranged marriage forces two families to smooth the edges of their jagged past with the hopes of a new beginning. But can a union tainted with secrets and uncertainty promise an unbreakable alliance? </p> <p>The one thing that Elias and Cress share in common is family over everything, but should they continue to fight for family when that same family has never truly fought for them? </p> <p>*Please see trigger warnings in the author's note.*</p>"; 
